import { createBrowserRouter } from 'react-router-dom';
import Shop from '../pages/Shop/Shop';

// create public routes

const publicRoute = createBrowserRouter([
    {
        path : '/',
        element : <Shop /> 
    }
]);

// export 
export default publicRoute;
